import React from 'react';
import {Link} from 'react-router-dom'
const Menu=()=>{
    return (
        <>
        <Link to='/'> About us </Link>
        <Link to='/Cobtact'> contact us </Link>
        <br/>
          <a href="/">about</a>
          <a href="/">contact</a>
        </>
    )
    }
export default Menu
